import React, { useState, useEffect, useRef } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';

import './AboutMe.css';

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});
  const sectionRefs = useRef([]);

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);

    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('visible');
          }
        });
      },
      { threshold: 0.1 }
    );

    sectionRefs.current.forEach((ref) => {
      if (ref) observer.observe(ref);
    });

    return () => {
      window.removeEventListener('resize', updateView);
      sectionRefs.current.forEach((ref) => {
        if (ref) observer.unobserve(ref);
      });
    };
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: '🌍 Renuem',
      description: (
        <ul>
          <li>Developed a renewable energy investment app using React Native and Node.js.</li>
          <li>Deployed backend on AWS with MySQL RDS for real-time tracking.</li>
          <li>Aligned app with business goals for user engagement.</li>
        </ul>
      ),
    },
    {
      id: '2024',
      icon: clearear,
      title: '💼 Clear Ear',
      description: (
        <ul>
          <li>Built an Android app to manage hearing clinic appointments.</li>
          <li>Integrated local AsyncStorage database for patient records.</li>
        </ul>
      ),
    },
    {
      id: '2020-2023',
      icon: MosGames,
      title: '🎮 Mo’s Pvt',
      description: (
        <ul>
          <li>Conducted data analysis for product launches.</li>
          <li>Developed and maintained Mo’s Games website.</li>
        </ul>
      ),
    },
  ];

  return (
    <div className="main-content">
      <div className="section hero-section" ref={(el) => (sectionRefs.current[0] = el)}>
        <img src={untitled} alt="Mohammed" className="profile-image" />
        <div className="hero-paragraph">
          <p>
            With over 7 years of experience as a Full Stack Developer, I’ve built efficient, user-focused solutions bridging technical innovation with real-world impact.
          </p>
        </div>
      </div>

      <h3 className="section-header section" ref={(el) => (sectionRefs.current[1] = el)}>
        Tech Languages
      </h3>
      <div className="logo-container">
        {techLanguages.map((lang) => (
          <div
            key={lang.id}
            className="logo-wrapper"
            onMouseEnter={() => handleLogoHover(lang.id)}
            onMouseLeave={() => handleLogoLeave(lang.id)}
          >
            <img src={lang.src} alt={lang.name} className="tech-logo" />
            <span className={`tooltip ${tooltipVisible[lang.id] ? 'visible' : ''}`}>{lang.name}</span>
          </div>
        ))}
      </div>

      <h3 className="section-header section" ref={(el) => (sectionRefs.current[2] = el)}>
        Work History
      </h3>
      <Timeline position={isMobileView ? 'right' : 'alternate'}>
        {workHistory.map((history, index) => (
          <TimelineItem key={index}>
            <TimelineOppositeContent>
              <Typography variant="body2" className="timeline-date">
                {history.id}
              </Typography>
            </TimelineOppositeContent>
            <TimelineSeparator>
              <img src={history.icon} alt={history.title} className="timeline-icon" />
              <TimelineConnector className="timeline-connector" />
            </TimelineSeparator>
            <TimelineContent>
              <Typography variant="h6" className="timeline-title">
                {history.title}
              </Typography>
              {history.description}
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
